import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Viewproj() {
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:9000/getProjects')
      .then(response => {
        setProjects(response.data);
      })
      .catch(error => {
        console.error('Error fetching projects:', error);
      });
  }, []);

  return (
    <div>
      <h2>View All Projects</h2>
      <ul>
        {projects.map(project => (
          <><li key={project._id}>{project.project_name}</li><li key={project._id}>{project.description}</li>
          <li key={project._id}>{project.manager_details}</li><li key={project._id}>{project.owner_details}</li>
          <li key={project._id}>{project.teams_details}</li></>
        ))}
      </ul>
    </div>
  );

}

export default Viewproj;
